#[wasm_bindgen_test]
async fn import_two_contracts() {
    set_panic_hook();
    let mnemonic = env!("TEST_WALLET_SEED", "TEST_WALLET_SEED variable not set");
    hash_password(ENCRYPTION_PASSWORD.to_owned());

    info!("Import wallet");
    let mnemonic_data_str = resolve(encrypt_wallet(
        mnemonic.to_owned(),
        SEED_PASSWORD.to_owned(),
    ))
    .await;
    let mnemonic_data: SecretString = json_parse(&mnemonic_data_str);

    info!("Get vault properties");
    let vault_str: JsValue = resolve(decrypt_wallet(mnemonic_data.0.clone())).await;
    let wallet_data: DecryptedWalletData = json_parse(&vault_str);
    let sk = &wallet_data.private.nostr_prv;

    info!("Import Contract (Fungible)");
    let contract_import = ImportRequest {
        import: AssetType::RGB20,
        data: FUNGIBLE_CONTRACT.to_string(),
    };
    let req = serde_wasm_bindgen::to_value(&contract_import).expect("oh no!");
    let resp: JsValue = resolve(import_contract((&sk).to_string(), req)).await;
    let resp: ContractResponse = json_parse(&resp);
    assert_eq!("RGB20", resp.iface);

    info!("Import Contract (UDA)");
    let contract_import = ImportRequest {
        import: AssetType::RGB21,
        data: UDA_CONTRACT.to_string(),
    };
    let req = serde_wasm_bindgen::to_value(&contract_import).expect("oh no!");
    let resp: JsValue = resolve(import_contract((&sk).to_string(), req)).await;
    let resp: ContractResponse = json_parse(&resp);
    assert_eq!("RGB21", resp.iface);
}

#[wasm_bindgen_test]
async fn asset_transfer() {
    set_panic_hook();

    let mnemonic = env!("TEST_WALLET_SEED", "TEST_WALLET_SEED variable not set");
    hash_password(ENCRYPTION_PASSWORD.to_owned());

    // Import wallet
    let mnemonic_data_str = resolve(encrypt_wallet(
        mnemonic.to_owned(),
        SEED_PASSWORD.to_owned(),
    ))
    .await;

    let mnemonic_data: SecretString = json_parse(&mnemonic_data_str);

    // Get vault properties
    let wallet_data_str: JsValue = resolve(decrypt_wallet(mnemonic_data.0.clone().clone())).await;
    let wallet_data: DecryptedWalletData = json_parse(&wallet_data_str);

    info!("Get Wallets");
    let assets_wallet = resolve(get_wallet_data(
        wallet_data.public.rgb_assets_descriptor_xpub.clone(),
        None,
    ))
    .await;
    let assets_wallet: WalletData = json_parse(&assets_wallet);
    let udas_wallet = resolve(get_wallet_data(
        wallet_data.public.rgb_udas_descriptor_xpub.clone(),
        None,
    ))
    .await;
    let udas_wallet: WalletData = json_parse(&udas_wallet);

    info!("Check Asset Vault");
    let vault_details = resolve(get_assets_vault(
        wallet_data.public.rgb_assets_descriptor_xpub.clone(),
        wallet_data.public.rgb_udas_descriptor_xpub.clone(),
    ))
    .await;
    let vault_details: FundVaultDetails = json_parse(&vault_details);
}
